import React, { Component } from "react";

class Home extends Component {
      render() {
            return (
                  <>
                        <div id="header"> 
                            <img src = "../imgs/olin.png" alt = "logo" />
                        </div>
                        <div id="flexContainer1">
                              <div id="sidebar"> </div>
                              <div id="mainContent"> </div>
                        </div>
                  </>
            );
      }
}

export default Home;
